/*
Aquí puede encontrar los códigos para la creacion del PDF: https://parall.ax/products/jspdf  
Códigos estras: https://rawgit.com/MrRio/jsPDF/master/docs/jsPDF.html  
*/
function crear() {
	/*
	 Deberá convertir su imagen en una URL de datos
	 Utilice esta pagina: https://dataurl.sveinbjorn.org/#dataurlmaker
	*/
	var img = 'data:image/jpeg;base64,'
	var doc = new jsPDF()
	doc.setFontSize(40)
	// X y Y, texto de la portada. 
	doc.text(35, 35, 'Josue Antonio jsPDF')
	//Mostrar lo que escribe el usuario 
	var nombre = document.getElementById('texto').value
	//Coordenada X , Y y el testo escrito
	doc.text(60, 60, nombre)
	/*
	Variable img, Tipo o formato de la imagen, coordenada x, coordenada y, Ancho, Largo
	*/
	doc.addImage(img , 'JPEG', 15, 90, 180, 150)
	/*
	Para crear un triangulo en el PDF
	doc.triangle(80, 80, 100, 200, 100, 300)
	*/
	// Guardar jsPDf
	doc.save('Example.pdf')
}